INSERT INTO `cuboverde`.`Publications` (`IdPublication`,`IdCategory`,`TypePublication`,`TitlePublication`,`DescriptionPublication`,`Approved`,`IdUser`,`PublicationDate`,`CreationDate`,`Favorites`,`Shared`,`Likes`,`Images`) VALUES (2001, 2, NULL, 'Gobierno aprueba ley de energía solar obligatoria en nuevas construcciones', 'El gobierno ha aprobado una ley que exige la instalación de paneles solares en todas las nuevas construcciones residenciales y comerciales. Esta medida busca acelerar la transición hacia las energías renovables y reducir la dependencia de los combustibles fósiles en el sector inmobiliario. La ley será un incentivo clave para aumentar la generación de energía solar y contribuir a los objetivos de sostenibilidad a nivel nacional.', '1', 1, '2024-05-13 09:00', '2024-05-13 09:00', 358, 171, 645, 'ley_energia_solar.jpg'),(2002, 3, NULL, 'Municipio implementa sistema de recolección de residuos orgánicos puerta a puerta', 'El municipio ha puesto en marcha un nuevo sistema de recolección de residuos orgánicos, que permite a los vecinos separar sus desechos de cocina y jardín para su posterior compostaje. Este programa, implementado en toda la ciudad, tiene como objetivo reducir significativamente la cantidad de materia orgánica que termina en los vertederos, convirtiéndola en abono natural que beneficia a los jardines y huertas locales. Es un importante avance hacia una gestión más sostenible de los residuos.', '1', 1, '2024-05-12 14:20', '2024-05-12 14:20', 275, 138, 524, 'recoleccion_residuos_organicos.jpg'),(2003, 8, NULL, 'Estudio revela impacto devastador de la deforestación en el Amazonas', 'Un reciente estudio científico ha revelado que la deforestación en la Amazonía ha alcanzado niveles alarmantes, con la pérdida de millones de hectáreas de selva tropical en los últimos años. Esto no solo representa una amenaza grave para la biodiversidad de la región, sino que también tiene un impacto devastador en el equilibrio climático global. El informe subraya la urgencia de implementar medidas efectivas de protección y reforestación para salvaguardar este pulmón verde del planeta.', '0', 1, '2024-05-11 10:45', '2024-05-11 10:45', 412, 201, 715, 'deforestacion_amazonia.jpg'),(2004, 8, NULL, 'Empresa de cosméticos lanza línea de productos con envases reciclados y biodegradables', 'Una reconocida empresa de cosméticos ha lanzado una línea de productos con envases fabricados a partir de materiales reciclados y biodegradables. Esta iniciativa forma parte de los esfuerzos de la industria por reducir el impacto ambiental de los empaques, en línea con los principios de la economía circular. Los consumidores ahora tienen más opciones sostenibles para cuidar su belleza sin generar residuos contaminantes.', '0', 12, '2024-05-10 16:10', '2024-05-10 16:10', 322, 159, 623, 'cosmeticos_envases_sostenibles.jpg'),(2005, 1, NULL, 'Parque nacional amplía área de protección para conservar especies en peligro', 'Las autoridades del parque nacional han anunciado la ampliación del área protegida, con el objetivo de preservar y rehabilitar los hábitats de especies en peligro de extinción. Esta medida es fundamental para garantizar la supervivencia de la flora y fauna endémicas de la región, que enfrentan amenazas constantes debido a la intervención humana. La expansión de las zonas de conservación es un paso crucial para fortalecer la protección de la biodiversidad local.', '0', 1, '2024-05-09 12:30', '2024-05-09 12:30', 371, 184, 726, 'ampliacion_area_protegida.jpg'),(2006, 3, NULL, 'Parque nacional Natural', 'Prueba de guardado de publicación segunda', '0', 3, '2024-06-11 12:50', '2024-06-11', 0, 0, 0, 'ampliacion_area_protegida.jpg')
;
